import React from "react";
import { useNavigate } from "react-router-dom";

const Logout = ({ logoutKey }) => {
    const navigate = useNavigate();

    const handleLogout = async () => {
        // Perform any logout logic here, like clearing tokens or user data

        // After logout, update the key in the parent component if necessary
        logoutKey();

        // Redirect to the confirmation page or directly to the login page
        navigate('/logoutconfirmation'); // You can customize this route as needed
    };

    return (
        <div>
            <section className="section-container"> 
                <button onClick={handleLogout}>Logout</button>
            </section>
        </div>
    );
};

export default Logout;
